Episode Title: &quot;Maced in the Face!; Divorced and Still Fighting!&quot;
Episode Order: Season 18, Episode 129
Original Air Date: February 04, 2014

&quot;A man who had tear gas sprayed in his face says his friend was responsible for driving him home, and a witness says they hit her parked car; a mother sues her ex and his wife for a child-support lien on her home.&quot;

Seed and enjoy!
